  <body>
    <canvas canvas id="gameboy" width="640" height="576"></canvas>
    <div id="chat" class="chat"></div>
    <script>
      var cout = (msg) => console.log(msg);
      settings[0] = false;
      start(document.getElementById('gameboy'), atob(rom));

      var lastKey = null;
      var lastKeyTimeout = null;
      var keyPressed = (key) => {
        if (lastKey != key)
        {
          if (lastKey != null)
          {
            GameBoyKeyUp(lastKey);
            clearTimeout(lastKeyTimeout);
          }
          GameBoyKeyDown(key);
        }
        lastKey = key;
        lastKeyTimeout = setTimeout(() => {
          GameBoyKeyUp(lastKey);
          lastKey = null;
        }, 260);
      }

      var client = new tmi.Client({
        connection: {
          reconnect: true
        },
        identity: {
          username: twitchUserName,
          password: oauth
        },
        channels: [twitchUserName]
      });
      client.on('message', (channel, userState, message, senderIsSelf) => {
        var keymap = ['right', 'left', 'up', 'down', 'a', 'b', 'select', 'start'];
        var key = message.toLowerCase();
        if (keymap.indexOf(key) > -1)
        {
          keyPressed(key);
          var msg = document.createElement('div');
          var span = document.createElement('span');
          span.appendChild(document.createTextNode(userState['display-name'] + ': ' + key));
          msg.appendChild(span);
          var chat = document.getElementById('chat');
          chat.insertBefore(msg, chat.firstChild);
        }
      });
      client.connect();
    </script>
  </body>
